DROP TABLE  if exists  ns_exhibitions cascade;
CREATE TABLE ns_exhibitions (exh_exhibitname CHARACTER VARYING(150) NOT NULL, exh_museumname CHARACTER VARYING(50) NOT NULL, exh_exhibitdatestart DATE NOT NULL, exh_exhibitdateend DATE NOT NULL, exh_securitypersonname CHARACTER VARYING(75), exh_istravellingexhibition BOOLEAN, exh_description TEXT, PRIMARY KEY (exh_exhibitname, exh_museumname, exh_exhibitdatestart));
DROP TABLE if exists  ns_exhibitionworks cascade;
CREATE TABLE ns_exhibitionworks (exw_exhibitname CHARACTER VARYING(150) NOT NULL, exw_exhibitdatestart DATE NOT NULL, exw_museumofexhibition CHARACTER VARYING(50) NOT NULL, exw_workcharid CHARACTER VARYING(10) NOT NULL, exw_worknumid BIGINT NOT NULL, exw_workdatabaseentrymuseum CHARACTER VARYING(50) NOT NULL, exw_dateworkadded DATE NOT NULL, exw_dateworkremoved DATE, PRIMARY KEY (exw_exhibitname, exw_exhibitdatestart, exw_museumofexhibition, exw_workcharid, exw_worknumid, exw_workdatabaseentrymuseum, exw_dateworkadded));
DROP TABLE if exists  ns_locations cascade;
