DROP TABLE  if exists  ns_workowners cascade;
CREATE TABLE ns_workowners (won_workcharid CHARACTER VARYING(10) NOT NULL, won_worknumid BIGINT NOT NULL, won_workdatabaseentrylocation CHARACTER VARYING(50) NOT NULL, won_ownername CHARACTER VARYING(50) NOT NULL, won_ownershipdatestart TIMESTAMP(6) WITHOUT TIME ZONE NOT NULL, won_ownershipdateend TIMESTAMP(6) WITHOUT TIME ZONE, PRIMARY KEY (won_workcharid, won_worknumid, won_workdatabaseentrylocation, won_ownername, won_ownershipdatestart));
DROP TABLE  if exists ns_works cascade;
