INSERT INTO ns_exhibitions (exh_exhibitname, exh_museumname, exh_exhibitdatestart, exh_exhibitdateend, exh_securitypersonname, exh_istravellingexhibition, exh_description) VALUES ('Dimension of Culture: Middle Eastern', 'Israel_Museum', '2016-08-01', '2016-12-20', 'Jenny Green', false, 'The countries of the Middle East have some but not all things in common. This is not a surprise, since the area consists of approximately 20 countries, according to PBS. The Arabic language is one thing that is common throughout the region; however, the wide variety of dialect can sometimes make communication difficult. Religion is another cultural area that the countries of the Middle East have in common.  The Middle East is the birthplace of Judaism, Christianity and Islam.');
INSERT INTO ns_exhibitions (exh_exhibitname, exh_museumname, exh_exhibitdatestart, exh_exhibitdateend, exh_securitypersonname, exh_istravellingexhibition, exh_description) VALUES ('REVISION of Culture:Asian', 'Israel_Museum', '2017-01-06', '2017-05-06', 'Jenny Green', false, 'United in diversity - a cunningly chosen motto by the EU, as this is what many Europeans love about their continent - the many beautiful, stimulating and varied cultures concentrated in a relatively small place, and the possibility to travel, study and work seamlessly across most of the continent and experience this amazing diversity. We have a lot of works which can represent the culture of European Culture');
