INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 3, 'Israel_Museum', 'The goddess Ganga riding on a large fish on the river Ganges ', 'he goddess Ganga riding on a large fish on the river Ganges', 'Painting', 'Asian Art Painting', 'India', '1839-10-11', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 4, 'Israel_Museum', 'Shivas family', 'While the sacred texts delight in telling of the quarrels that animate the life of Shiva and Parvati, the painters of the Punjab Hills celebrated their familial and marital bliss. The family, including Shiva and Parvatis six-faced son Karttikeya and their elephant-headed son Ganesha, lives happily together in a cave alongside their attendant animals  the bull Nandi and the lion. The formation of the rocks in this scene is painted in the traditional north Indian style.', 'Painting', 'Asian Art Painting', 'Arturo Schwarz', '1864-10-24', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 5, 'Israel_Museum', 'Vishnu and Lakshmi on a royal seat, worshipped by a crowned Garuda and by a lady holding a fly whisk, an emblem of authority', 'VishnuandLakshmion aroyal seat,worshippedby acrowned Garudaand by alady holdingafly whisk, anemblemofauthority', 'Painting', 'Asian Art Painting', 'Arturo Schwarz', '1762-12-27', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 6, 'Israel_Museum', 'Army of Hindu gods and demons ', 'Ancient Hindu wars are the battles described in the Hindu texts of ancient India. These battles depict great heroes, demons, celestial weapons and beings', 'Painting', 'Asian Art Painting', 'Arturo Schwarz', '1724-12-13', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 7, 'Israel_Museum', 'Shiva with five faces and water pouring from his head into the river Ganges ', 'Shiva with five faces and water pouring from his head into the river Ganges. Shiva with five faces and water pouring from his head into the river Ganges', 'Painting', 'Asian Art Painting', 'Paul Wonner', '1739-11-17', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 8, 'Israel_Museum', 'Rama and Hanuman battling Ravana, the Demon King, and his army', 'The epic narrates the life of Rama, the legendary prince of Kosala Kingdom, his banishment from the kingdom by his father, King Dasharatha, his travels across forests in India with his wife Sita and brother Lakshmana, the kidnap of his wife by Ravana, the demon king of Lanka, resulting in a war with him, and Ramas eventual return to Ayodhya to be crowned king.', 'Painting', 'Asian Art Painting', 'India', '1927-11-28', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 9, 'Israel_Museum', 'Vishnu and Lakshmi seated on the back of Garuda, Vishnus attendant animal ', 'Vaikuntha ChaturmurtiorVaikuntha Vishnuis a four-headed aspect of the Hindu godVishnu, mostly found inKashmir(northern part of the Indian subcontinent). The icon represents Vishnu as theSupreme Being. He has a human head, a lion head, a boar head and a demonic head. Sometimes, even three-headed aspects of Vishnu where the demonic rear head is dropped are considered to represent Vaikuntha Chaturmurti. Though iconographical treatises describe him to eight-armed, he is often depicted with four. Generally, Vaikuntha Chaturmurti is shown standing but sometimes he is depicted seated on hisvahana(mount)Garuda.', 'Painting', 'Asian Art Painting', 'India', '1874-10-21', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 1, 'Israel_Museum', 'Cup in the form of a boy clinging to a lotus stalk ', 'With her rich jewelry and elaborate crown, inlayed with semiprecious stones, the goddess is represented as a real and beautiful woman  approachable and sure to grant the supplicants requests.', 'Carving', 'Asian Art Sculpture', ' Ruth Jacobs', '1968-11-15', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 2, 'Israel_Museum', 'Amida Buddha standing on a lotus base, backed by a flaming halo ', 'Small shrine with the image of Amida Buddha, standing on a lotus base with one hand up and one hand down in mudra in front of a tall mandala. Gilt wood figure and base, mandala made of gilt metal', 'Carving', 'Asian Art Sculpture', 'Japan ', '1903-11-14', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 270, 'Israel_Museum', 'Head of a bodhisattva ', 'Bodhisattvas are distinguished from figures of the Buddha by being adorned with jewellery, and also having beards and moustaches. This jewellery is characteristic of Gandharan art. A circular indent on his forehead, called an urna, is a mark of nobility and illumination, and would have been inlaid with a precious stone', 'Carving', 'Asian Art Sculpture', 'China', '1823-10-28', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 699, 'Israel_Museum', 'Standing figure of a Buddhist disciple ', 'Standing figure of a Buddhist disciple. Similar Items. Buddhist priest The Israel Museum', 'Carving', 'Asian Art Sculpture', 'China', '1781-12-20', true, null, null, null);
