INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 337, 'Israel_Museum', 'Head of an elderly woman with a twisted headscarf', 'ead of an elderly woman with a twisted headscarf. Head of an elderly woman with a twisted headscarf. Similar Items. Head of a man The Israel Museum', 'Carving', 'Asian Art Sculpture', 'India', '1819-10-26', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 497, 'Israel_Museum', 'Head of a man ', 'Bequest of Wolf Ladejinsky, Washington, DC, through the America-Israel Cultural Foundation ', 'Carving', 'Asian Art Sculpture', 'India', '1766-11-15', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 410, 'Israel_Museum', 'Statuette of Kherduankh, venerated as mother of the divine Imhotep', 'The Feather of Maat amulet was a potent talisman in ancient Egypt. The talisman or amulet was often worn by the judges and magistrates of ancient Egypt as an icon of integrity, morality, fairness and truth. The amulet or talisman was ascribed with magical powers and the Spirit of Maat. The following information and facts about the Feather of Maat amulet provides a fascinating insight into the ancient Egyptians.', 'Carving', 'Egyptian Archaeology Sculpture', 'Abraham Guterman', '1885-10-14', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 544, 'Israel_Museum', 'Amulet of Maat, seated, the ostrich feather on her head now lost', 'The Feather of Maat amulet was a potent talisman in ancient Egypt. The talisman or amulet was often worn by the judges and magistrates of ancient Egypt as an icon of integrity, morality, fairness and truth. The amulet or talisman was ascribed with magical powers and the Spirit of Maat. The following information and facts about the Feather of Maat amulet provides a fascinating insight into the ancient Egyptians.', 'Carving', 'Egyptian Archaeology Sculpture', 'Egypt', '1766-12-29', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 286, 'Israel_Museum', 'Statuette of Ptah', 'In Egyptian mythology, Ptah is the demiurge of Memphis, god of craftsmen and architects. In the ... Statue of Ptah - Egyptian Museum of Turin', 'Carving', 'Egyptian Archaeology Sculpture', 'Egypt', '1889-11-11', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 121, 'Israel_Museum', 'Statuette of Horus the child', 'Statuette of Horus the child, legitimate heir to the throne, shown in the customary depiction of children in ancient Egypt - nude, his finger in his mouth, and with the sidelock of youth', 'Carving', 'Egyptian Archaeology Sculpture', 'Egypt', '1882-12-24', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 321, 'Israel_Museum', 'Statuette of Ptah', 'Statuette of Ptah, god of the capital Memphis and patron of artisans', 'Carving', 'Egyptian Archaeology Sculpture', 'Egypt', '1775-12-25', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 43, 'Israel_Museum', 'Boats', 'Born in a shtetl in Czarist Russia, Miron Sima first studied art in Odessa in 1921.In the following year he moved to Dresden, Germany to continue his studies.', 'Painting', 'Israel Art Painting', 'Miron Sima', '1745-10-16', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 656, 'Israel_Museum', 'Statuette of a female offering bearer carrying a box filled with flour and holding a duck', 'Wooden models illustrating daily life, along with a supply of provisions for the deceased, were common in Egyptian tombs of this period. They provided detailed representations of houses, gardens, granaries, army troops, boats, workshops, and people. This type of female offering-bearer guaranteed provisions for the deceased. Often larger than the models of daily life, these figures are usually depicted carrying a basket on their head, filled with food stores such as meat, bread, wine, or flour. The basket is always supported by the left hand, and in many cases a live duck is held in the right hand. The offering-bearers may appear singly or in pairs, either in the tomb chapel or in the burial chamber.', 'Carving', 'Egyptian Archaeology Sculpture', 'Egypt', '1813-12-21', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 435, 'Israel_Museum', 'ElaborateShabtiof the Lady of the House , a title commonly used for married women', 'Perceiving the realm of the dead primarily as a continuation of earthly existence, the ancient Egyptians described the afterlife in terms of their agricultural society. This is reflected in the shabti-a funerary statuette made to serve as a substitute for its owner in performing menial corvee labor in the afterlife. Such labor, consisting mainly of seasonal agricultural work for the king, was imposed on the majority of the population, and only a privileged few were exempt. The fear of being summoned for corvee work in the afterlife was shared by all Egyptians; shabti statuettes were placed in tombs of all members of the elite, men as well as women, including the king. Usually represented mummiform with agricultural tools in their hands and baskets hanging from their back, shabtis were made of various materials', 'Carving', 'Egyptian Archaeology Sculpture', 'Egypt', '1912-12-25', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 483, 'Israel_Museum', 'Mask (lukwakongo)', 'The Lega people (or Warega) are an ethnic group of the Democratic Republic of the Congo. In 1998 their population was about 250,000.[1]', 'Carving', 'Egyptian Archaeology Sculpture', 'Lega people', '1906-10-16', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 10, 'Israel_Museum', 'Jan Victors ', 'Jan Victorsor Fictor (bapt. June 13, 1619  December 1679) was a Dutch Golden Age painter that focused mainly on painting subjects from the Bible', 'Painting', 'European Art Painting', 'Emile E. Wolf', '1715-10-28', true, null, null, null);
