INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 15, 'Israel_Museum', 'Frans Francken the Younger', 'Frans Francken the Younger(Antwerp, 1581  Antwerp, 6 May 1642) was a Flemish painter and the best-known member of the large Francken family of artists', 'Painting', 'European Art Painting', 'Flemish', '1972-11-15', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 16, 'Israel_Museum', 'The Death of Adonis', 'The Antwerp-based master Sir Peter Paul Rubens, considered to be the preeminent Flemish Baroque artist, was a diplomat as well as a painter, draftsman, and gentleman. His extensive travels in the service of princes and kings to the courts of Italy and Spain exposed him to the best of Renaissance painting, sculpture, and literature and acquainted him with two of the most illustrious painters of his time: Caravaggio and Velazquez.', 'Painting', 'European Art Painting', 'Peter Paul Rubens', '1741-12-18', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 273, 'Israel_Museum', 'St. Florian', 'Saint Florianwas a Christian holy man, and the patron saint of Linz, Austria; chimney sweeps; soapmakers, and firefighters', 'Carving', 'European Art Sculpture', 'Germany', '1872-12-26', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 349, 'Israel_Museum', 'Two Cupids Fighting Over a Heart', 'Patricia Wengrafs article,LeClercqs marble group of Eros and Anteros fighting over a HeartinBarocke Kunststckh Festschrift fr Christian Theuerkauff/Sculpture Studies in Honour of Christian Theuerkauff,Eds. R. Marth & M. Trusted, Munich, 2011, pp. 185-189', 'Carving', 'European Art Sculpture', 'Francois-Joseph Leclercq', '1892-12-11', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 995, 'Israel_Museum', 'The Fate Atropos', 'Atroposor Aisa in Greek mythology, was one of the three Moirai, goddesses offateand destiny', 'Carving', 'European Art Sculpture', 'Late', '1745-11-10', true, null, null, null);
