INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 107, 'Israel_Museum', 'Portrait of the Novelist Ivan Sergeyevich Turgenev', 'Ivan Sergeyevich Turgenevwas a Russiannovelist, short storywriter, and playwright', 'Carving', 'European Art Sculpture', 'Mark Antokolski', '1818-12-19', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 189, 'Israel_Museum', 'Severed Head of John the Baptist on a Platter', 'TheBeheading of Saint John the Baptist, also known as theDecollation of Saint John the Baptistor theBeheading of the Forerunner, is aholy dayobserved by variousChristianchurches that followliturgical traditions. The day commemorates themartyrdombybeheadingofSaint John the Baptiston the orders ofHerod Antipasthrough the vengeful request of his step-daughterSalomeand her mother.', 'Carving', 'European Art Sculpture', 'Mark Antokolski', '1966-11-28', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 75, 'Israel_Museum', 'Allegory of Commerce and Agriculture with Mercury and Ceres', 'Johannes Josephus Nicolaus Delin Flemish, active France, 17761811.Allegory of Commerce and Agriculture with Mercury and CeresUndated Oil on canvas', 'Carving', 'European Art Sculpture', 'Johannes Josephus Nicolaus Delin', '1826-10-19', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 24, 'Israel_Museum', 'First Fruits', 'The triptych format, often used for church altarpieces, endows the work with a certain sanctity and solemnity. The central panel contains an updated, allegorical depiction of the ritual offering of the first fruits. The figures symbolize different local types. The brawny Atlas-like farmer with a watermelon on his back is the pioneer, emblem of the New Hebrew who is in touch with nature. The woman beside him resembles a fertility goddess. The Yemenite couple represents Jews of the Orient who carry on the age-old, devout way of life. Modest and traditional, they lack the confident physicality of the other couple; the offering they bear is their child, the fruit of their loins. The Arabs in the two side panels are essentially part of the landscape: secondary characters in this drama, they do not participate in the productive work that drives the world.', 'Painting', 'Israel Art Painting', 'Reuven Rubin', '1806-11-14', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 44, 'Israel_Museum', 'Portrait of Toscanini', 'For a seven year period Sima both studied and worked at Dresdens Academy of Fine Arts under the important Expressionist artist, Otto Dix.Dix taught Sima both painting and graphic art techniques and had a wide ranging influence upon the younger artist.Like Dix, Sima often explored the effects of poverty and victimization in his art.', 'Painting', 'Israel Art Painting', 'Miron Sima', '1748-10-29', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 45, 'Israel_Museum', 'Jewish Cemetery', 'Shimon Hillel Schlezinger was born on month day 1902, at birth place, to David Zeida Shlezinger and Miriam Shlezinger (born Bergman). Shimon had 5 siblings: Simon Hillel Shlezinger, Alta Holtzman (born Shlezinger) and 3 other siblings.', 'Painting', 'Israel Art Painting', 'Shimon Hillel Schlezinger', '1777-10-29', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 25, 'Israel_Museum', 'An Allegorical Wedding: Sketch for a carpet dedicated to Mr. and Mrs. David Wolffsohn', 'It is a sketch for a carpet that was to be woven at Bezalel in honor of the 25th wedding anniversary of David Wolffsohn, president of the World Zionist Organization and heir to Theodor Herzl. At the right Exile is represented by Jeremiah, the biblical prophet who foretold the destruction of Jerusalem, while the left-hand panel shows Redemption. In the center are the bride and groom: he is portrayed as a blend of the Assyrian king Tiglath-Pileser and portraits of Herzl and Wolffsohn himself; she is an icon of the virtuous Jewish woman. Their wedding ceremony symbolizes the merging of the Zionist ideal with the Jewish people, while the entire triptych spans all of Jewish history, from biblical sovereignty to modern Zionist redemption.', 'Painting', 'Israel Art Painting', 'Ephraim Moses Lilien', '1800-10-23', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 26, 'Israel_Museum', 'Red Landscape', 'Ardon was born Max Bronstein in 1896 in Tuchw, Galicia (then Austria-Hungary, now Poland). In 1933 he emigrated to Jerusalem in Mandate Palestine.[2] He was granted Palestinian citizenship in 1936 and changed his name to Mordecai Ardon.', 'Painting', 'Israel Art Painting', 'Mordechai Ardon', '1777-12-18', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 27, 'Israel_Museum', 'Noire Basse', 'Avigdor Arikha was born to German-speaking Jewish parents in R?d?u?i, but grew up in Czernowitz in Bukovina, Romania (now in Ukraine).[1] His family faced forced deportation in 1941 to the Romanian-run concentration camps of Transnistria, where his father died. He survived thanks to the drawings he made of deportation scenes, which were shown to delegates of the International Red Cross.', 'Painting', 'Israel Art Painting', 'Avigdor Arikha', '1972-11-15', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 28, 'Israel_Museum', 'Portrait of Jonathan', 'Arie Aroch (in Hebrew ???? ????; born 1908, in Russia  October 15, 1974, in Israel) was an Israeli painter and diplomat born in Kharkov, which was part of the Russian Empire (today part of the Ukraine). Arochs work was a mixture of Pop Art and abstract art, along with elements from his biography. In addition, many scholars of the history of Israeli art have pointed out Arochs pioneering use of Jewish themes in his works. His painting style included unstructured scribbling and drawing, and it influenced a broad range of artists, including Raffi Lavie, Aviva Uri, etc. Sarah Breitberg Semel, in her article, Agrippa versus Nimrod (1988), suggested Aroch as a model for the new Israeli concept of design in art, and suggested his painting, Agrippas Street was the representative of Jewish identity. In 1971, Aroch was awarded the Israel Prize in Painting for his work.', 'Painting', 'Israel Art Painting', 'Arie Aroch', '1937-11-22', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 29, 'Israel_Museum', 'Houseplants', '1974 Born in Jerusalem Lives and works in Tel Aviv Studies 2004-2006 MFA, Bezalel Academy of Art and Design, Tel Aviv 2000-2004 MA studies', 'Painting', 'Israel Art Painting', 'Maya Attoun', '1918-11-26', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 30, 'Israel_Museum', 'An Encounter', 'Born 1952 in Tel-Aviv, Israel. Lives and works in Tel-Aviv.', 'Painting', 'Israel Art Painting', 'Nurit David', '1708-11-12', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 34, 'Israel_Museum', 'Crusader Ruins in Tiberias', 'The Jewish Museum Berlin houses the largest Steinhardt collection in the world, including numerous graphic artworks and unpublished documents donated by Josefa Bar-On Steinhardt, the artists daughter.', 'Painting', 'Israel Art Painting', 'Jakob Steinhardt', '1766-11-16', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 35, 'Israel_Museum', 'The Meeting', 'The museum owns paintings, several hundred print graphics, and a collection of books illustrated by the artist.[2] It is also possible to discover some of his work at the Jewish Museum Frankfurt.', 'Painting', 'Israel Art Painting', 'Jakob Steinhardt', '1741-12-17', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 36, 'Israel_Museum', 'Celia', 'Yehezkel Streichman(1993-1906) was a Lithunian- born Israeli painter. He was drawn to art from an early age, studying painting with the Jewish artist Jacob Mesenblium. He immigrated to Israel in 1926 and studied at the Bezalel Academy. In the early 1930s he traveled to Italy and continued his studies in Florence. In the early stages of his artistic career, Streichmans works focused on traditional themes such as portraits and female nudity. Later, his style became modern and innovative, and was characterized by fierce brush strokes and dark colors. In the 1940s Streichman taught art at the Avni Institute, and later founded a private modern painting school with the artist Avigdor Stematsky. In 1948 he founded with other artists the groupNew Horizons. In 1941 Streichman was awarded with the Dizengoff prize, and in 1991 he won the Israel Prize for painting.', 'Painting', 'Israel Art Painting', 'Yehezkel Streichman', '1913-10-23', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 37, 'Israel_Museum', 'omb of Rabbi Meir Baal Hanes', 'Streichman studied at the Bezalel Academy of Art and Design with Arie Aroch in 192427.[4] He then completed his studies in Paris at the cole des Beaux-Arts (1927) and in Florence at the Academy of Art ', 'Painting', 'Israel Art Painting', 'Yehezkel Streichman', '1795-10-19', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 38, 'Israel_Museum', 'Painting', 'His painting style involved using successive thick layers of paint. He was an acclaimed painter in what was known as the modernist New Horizons (Ofakim Hadashim) group in 1950s Tel Aviv, which he founded in 1948 along with Joseph Zaritsky and Stematsky.[15] It painted in a French lyrical abstraction style.[16][17] He was President of the Israeli Artists and Painters Union.', 'Painting', 'Israel Art Painting', 'Yehezkel Streichman', '1869-10-25', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 39, 'Israel_Museum', 'Fig Tree in Studio Window', 'He won the Dizengoff Prize multiple times (1941, 1944, 1954, 1969), the Ramat Gan Prize (1956), the Moadon Milo Prize (1968), the Sandberg Prize for Israeli Art, awarded by the Israel Museum (1974), the Histadrut Prize (1986), the Israel Prize (1990). In 1948 he participated in 24th Venice Biennale. During the years 194144 he was a member of Kibbutz Ashdot Yaakov.', 'Painting', 'Israel Art Painting', 'Yehezkel Streichman', '1976-11-28', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 40, 'Israel_Museum', 'Portrait of Yitzhak Sadeh', 'Moshe Tamir was a Russian-born, Israeli painter of the 20th century.', 'Painting', 'Israel Art Painting', 'Moshe Tamir', '1971-11-20', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 41, 'Israel_Museum', 'The Painter and the Model', 'Zaritsky was one of the most influential figures in Israeli art. His dominant personality and painting talent gained him the respect and admiration of three generations of Israeli artists, from his contemporaries on, who have helped forge the history of art in Israel. Zaritsky aimed to instill Modernist norms and modes of expression in Israeli art. His personal idiom blended the international art style with the influence of the light and climatic conditions of the Land of Israel. The lyrical abstract style of the New Horizons group, of which he was a founding member, emphasized the artists expression of the human experience through painterly - formal and chromatic - rather than narrative elements.', 'Painting', 'Israel Art Painting', 'Yossef Zaritsky', '1735-10-27', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 42, 'Israel_Museum', 'Paris', 'The Painter and the Model belongs to a group of works Zaritsky made while giving art seminars in Kibbutz Naan between 1949 and 1952. The figure of the artist is reduced to an abstract, bifurcated stick topped by a round form that is reminiscent of a lightbulb surrounded by a halo of light. It stands in front of a canvas on an easel under a light patch of paint resembling a truncated torso in profile. The whole work is characterized by an abstraction and fragmentation into geometric forms.', 'Painting', 'Israel Art Painting', 'Yossef Zaritsky', '1965-11-21', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 46, 'Israel_Museum', 'Portrait of George Bernard', 'Rubin Zelicovici (later Reuven Rubin)[2] was born in Gala?i to a poor Romanian Jewish Hasidic family. He was the eighth of 13 children.[1] In 1912, he left for Ottoman-ruled Palestine to study art at Bezalel Academy of Art and Design in Jerusalem. Finding himself atAcademys teachers, he left for Paris, France,[3] in 1913 to pursue his studies at the cole Nationale Suprieure des Beaux-Arts. At the outbreak of  odds with the artistic views of the ', 'Painting', 'Israel Art Painting', 'Reuven Rubin', '1768-12-11', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 47, 'Israel_Museum', 'Moses and the Burning Bush', 'In 1921, he traveled to the United States with his friend and fellow artist, Arthur Kolnik, with whom he had shared a studio in Cern?u?i. In New York City, the two met artist Alfred Stieglitz, who was instrumental in organizing their first American show at the Anderson Gallery.', 'Painting', 'Israel Art Painting', 'Reuven Rubin', '1993-11-24', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 48, 'Israel_Museum', 'Girl with Lemons', 'The painters who depicted the countrys landscapes in the 1920s rebelled against Bezalel.', 'Painting', 'Israel Art Painting', 'Reuven Rubin', '1790-12-23', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 700, 'Israel_Museum', 'Couple', 'Hedwig Grossman was born in Germany in 1902. Her father was Polish and her mother, Hispanic. Hedwigs family grew up as assimilated and anti-Zionistic Jews. During her childhood, Hedwig joined a German youth movement Vender Fogal. She left this group to later join the Zionistic Jewish youth movement Blue and White', 'Carving', 'Israel Art Sculpture', 'Hedwig Grossman Lehmann', '1847-10-18', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 908, 'Israel_Museum', 'Hedgehog', 'Hedwig Grossman was born in Germany in 1902. Her father was Polish and her mother, Hispanic. Hedwigs family grew up as assimilated and anti-Zionistic Jews. During her childhood, Hedwig joined a German youth movement Vender Fogal. She left this group to later join the Zionistic Jewish youth movement Blue and White', 'Carving', 'Israel Art Sculpture', 'Hedwig Grossman Lehmann', '1807-10-15', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 145, 'Israel_Museum', 'Tributary', 'Michael Gitlins family emigrated from South Africa to Israel in 1948. Gitlin received his BA in English Literature and Art History from the Hebrew University of Jerusalem (1967). He simultaneously studied at the Bezalel Academy of Arts and Design in Jerusalem, graduating in 1967. Gitlin moved to New York City in 1970 and received an MFA from Pratt Institute (1972). His first museum show was at the Israel Museum in Jerusalem in 1977. That same year, his work was exhibited at the Documenta in Kassel, Germany. Gitlin was represented by the Schmela Gallery in Dsseldorf and works of his were acquired by such institutions as the Stedelijk Museum in Amsterdam and the Gugghenheim Museum in New York. In the 1980s, Gitlin taught sculpture at the Parsons School of Design and Columbia University in New York, the Bezalel Academy of Art in Jerusalem, and the University of California in Davis.', 'Carving', 'Israel Art Sculpture', 'Michael Gitlin', '1834-12-16', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 445, 'Israel_Museum', 'Armoured Corps Sculpture', 'Yitzhak Danziger (Hebrew:  26 June 1916  11 July 1977) was an Israeli sculptor. He was one of the pioneer sculptors of the Canaanite Movement, and later joined the Ofakim Hadashim (New Horizons) group.', 'Carving', 'Israel Art Sculpture', 'Itzhak Danziger', '1930-12-13', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 667, 'Israel_Museum', 'Breastplate', 'Yitzhak Danziger (Hebrew:  26 June 1916  11 July 1977) was an Israeli sculptor. He was one of the pioneer sculptors of the Canaanite Movement, and later joined the Ofakim Hadashim (New Horizons) group.', 'Carving', 'Israel Art Sculpture', 'Itzhak Danziger', '1811-11-10', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 167, 'Israel_Museum', 'Model for The Shepherd King', 'Yitzhak Danziger (Hebrew:  26 June 1916  11 July 1977) was an Israeli sculptor. He was one of the pioneer sculptors of the Canaanite Movement, and later joined the Ofakim Hadashim (New Horizons) group.', 'Carving', 'Israel Art Sculpture', 'Itzhak Danziger', '1749-12-26', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 296, 'Israel_Museum', 'The Sacrifice of Isaac', 'Kadishman artworks are presented in central locations in Israel, such as Habima Square and his paintings can be found in many different galleries in Israel. He is most famous for his metallic sculptures and colorful sheep paintings.', 'Carving', 'Israel Art Sculpture', 'Menashe Kadishman', '1816-12-25', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 17, 'Israel_Museum', 'Compositional Sketch for Medicine', 'Seen here is the only existing oil study for a monumental work that was created by Viennese modern master Gustav Klimt at the start of the twentieth century and destroyed at the end of World War II.In 1894 the Austrian Ministry of Culture and Education commissioned Klimt and his colleague Franz Matsch to paint allegorical depictions for the University of Vienna: Philosophy, Medicine, Jurisprudence, and Theology, which would surround a large central canvas devoted to Enlightenment. Intended to cover the ceiling of the Universitys newly built Great Hall, these works were expected to inspire awed enthusiasm for learning and scientific progress.In his study for Medicine, Klimt created a dramatic, dynamic composition. Hygieia, Greek goddess of health and cleanliness, stands in the lower foreground, identified by her mistletoe wreath and the bowl in her hand. A provocative female nude floats above her t', 'Painting', 'Modern Art  Painting', 'Gustav Klimt', '1700-11-18', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 18, 'Israel_Museum', 'Pond with Water Lilies', 'During the 1890s, Monet renovated the garden at his home in Giverny, introducing improvements that allowed him to cultivate water lilies in a pond on his property. Around this time he embarked on a cycle of tranquil and contemplative waterscapes to which he would devote himself for the last twenty-five years of his life. The first series of these paintings, exhibited in 1899, had the pond as its main motif and included the Japanese footbridge that spanned it. By 1903, however, Monet was concentrating almost exclusively on the pond and its reflections, focusing more and more on the water surface alone.', 'Painting', 'Modern Art  Painting', 'Claude Monet', '1849-12-17', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 19, 'Israel_Museum', 'Portrait of Mme', 'This uncommissioned painting displays the thick, hatched strokes, strong colors, and porcelain-like skin tones typical of Renoirs high-society portraits. The multicolored, warm red-oranges and gold that predominate in the background serve as a foil to the black-clad figure, the wife of a friend. The gold in her bracelets, pin, earrings, and dress links her to the background. Mme Paulin has the dreamy, meditating countenance that the Impressionists favored as a way of softening the posed quality of traditional portraits.', 'Painting', 'Modern Art  Painting', 'Pierre Auguste Renoir', '1730-11-13', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 20, 'Israel_Museum', 'The Praying Jew', 'Upon arriving in Paris from his native Russia in 1910, Chagall began acquainting himself with avantgarde painting styles. He absorbed elements of Fauvism and Cubism, combining them with Jewish and Russian folk motifs in an innovative manner. Around 1912, he began a series of works depicting aspects of Jewish religious life, as a declaration and demonstration of the potential of a modern Jewish art. In his early autobiography,My Life(192122), Chagall explained that his models for these pictures had been elderly beggars and itinerant Hasidim. Shown in profile, the praying figure in this work is executed in a modified Cubist style. Sharp contrasts communicate the emotional tone to the viewer. The rounded forms of the head, cheek, back, and faceted sleeve coexist with the sharp-edged nose, trousers, shirt, and phylactery. ', 'Painting', 'Modern Art  Painting', 'Marc Chagall', '1868-10-11', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 21, 'Israel_Museum', 'Country House by a River', 'In this work, the centrally placed house is composed of simplified geometric forms. Even its reflections and the surrounding water have an aspect of solidity and stability. Depth and volume are achieved by the manipulation of color alone, and result from the juxtaposition of darker and lighter shades and tones. Structured color planes composed of directional brushstrokes, particularly in the trees, further contribute to the overall architectural order of the composition.', 'Painting', 'Modern Art  Painting', 'Paul Czanne', '1763-10-28', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 22, 'Israel_Museum', 'Landscape with Dog', 'auguin arrived in Papeete, the capital of Tahiti, in June 1891, in search of an environment unscathed by modern civilization. To his great disappointment, he learned that Christian missionaries had largely destroyed the primitive lifestyle, tribal art, and pagan religion he had hoped to find there. Faced with this reality, Gauguin set out to reinvent the lost culture he sought, through observation of the little that remained of indigenous rites and lore, and by perusing books and using his imagination.', 'Painting', 'Modern Art  Painting', 'Paul Gauguin', '1754-11-16', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 23, 'Israel_Museum', 'Still Life with Mandolin', 'In our painting, the table takes center stage and is tipped forward so as to be almost vertical, while the corkscrew legs are viewed straight on. The legs anchor the composition to the bottom of the canvas, while the horizontal dado holds it solidly in place on both sides. Three curved lines above the table echo its form. The objects on its top are arrayed in modified Cubist style, making use of such devices as multiple points of view, intersecting and overlapping planes, shading in light and dark, distortions, and patterning.', 'Painting', 'Modern Art  Painting', 'Georges Braque', '1736-10-29', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 860, 'Israel_Museum', 'Fruit Torso (Torse fruit)', 'Jean ArporHans Arp(16 September 1886  7 June 1966) was a German-French sculptor, painter, poet, and abstract artist in other media such as torn and pasted paper.', 'Carving', 'Modern Art  Sculpture', 'Jean Arp', '1870-12-20', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 430, 'Israel_Museum', 'The Half-Doll', 'Hans Bellmer (13 March 1902  23 February 1975[citation needed]) was a German artist, best known for the life-sized pubescent female dolls he produced in the mid-1930s. Historians of art and photography also consider him a Surrealist photographer.', 'Carving', 'Modern Art  Sculpture', 'Fruit Torso (Torse fruit)', '1836-11-29', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 911, 'Israel_Museum', 'Bottle Rack', 'Henri-Robert-Marcel Duchamp (French: [ma?s?l dy???]; 28 July 1887  2 October 1968) was a French, naturalized American painter, sculptor, chess player and writer whose work is associated with Cubism, conceptual art and Dada,[1][2][3] although he was careful about his use of the term Dada[4] and was not directly associated with Dada groups. Duchamp is commonly regarded, along with Pablo Picasso and Henri Matisse, as one of the three artists who helped to define the revolutionary developments in the plastic arts in the opening decades of the twentieth century, responsible for significant developments in painting and sculpture.[5][6][7][8] Duchamp has had an immense impact on twentieth-century and twenty first-century art. By World War I, he had rejected the work of many of his fellow artists (like Henri Matisse) as retinal art, intended only to please the eye. ', 'Carving', 'Modern Art  Sculpture', 'Marcel Duchamp', '1850-12-19', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 824, 'Israel_Museum', 'Fresh Widow', 'Henri-Robert-Marcel Duchamp (French: [ma?s?l dy???]; 28 July 1887  2 October 1968) was a French, naturalized American painter, sculptor, chess player and writer whose work is associated with Cubism, conceptual art and Dada,[1][2][3] although he was careful about his use of the term Dada[4] and was not directly associated with Dada groups. Duchamp is commonly regarded, along with Pablo Picasso and Henri Matisse, as one of the three artists who helped to define the revolutionary developments in the plastic arts in the opening decades of the twentieth century, responsible for significant developments in painting and sculpture.[5][6][7][8] Duchamp has had an immense impact on twentieth-century and twenty first-century art. By World War I, he had rejected the work of many of his fellow artists (like Henri Matisse) as retinal art, intended only to please the eye. ', 'Carving', 'Modern Art  Sculpture', 'Marcel Duchamp', '1878-12-18', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 570, 'Israel_Museum', 'Doves - First Version', 'Sir Jacob Epstein KBE (10 November 1880  19 August 1959) was a British[1][2][3][4] sculptor who helped pioneer modern sculpture. He was born in the United States, and moved to Europe in 1902, becoming a British citizen in 1911. He often produced controversial works which challenged taboos on what was appropriate subject matter for public artworks. He also made paintings and drawings, and often exhibited his work', 'Carving', 'Modern Art  Sculpture', 'Jacob Epstein', '1873-12-10', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 787, 'Israel_Museum', 'Woman with Serpent', 'Jacques Lipchitz was born Chaim Jacob Lipschitz, in a Litvak family, son of a building contractor in Druskininkai, Lithuania, then within the Russian Empire. At first, under the influence of his father, he studied engineering, but soon after, supported by his mother he moved to Paris (1909) to study at the cole des Beaux-Arts and the Acadmie Julian.', 'Carving', 'Modern Art  Sculpture', 'Jacques Lipchitz', '1999-12-24', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 627, 'Israel_Museum', 'Ngilsociety mask', 'This Ngil mask from Gabon incorporates stylistic features typical of Fang figurative carving: a very broad forehead with a double arch over the eyes, heart-shaped face, and projecting mouth. The kaolin (pale clay) of the face conveys the color of the dead or of spirits.', 'Painting', 'Asian Art Painting', 'Egypt', '1889-11-17', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 622, 'Israel_Museum', 'Vabocult buffalo mask', 'The masks, which were a fearsome sight - firelight increased the dramatic effect of the fiber ruff and raffia strips usually included but not shown in this example - played an important part in the imposition of social order. The French banned their use following a series of ritual murders in 1910. After the ban, much information about Ngil society disappeared, and there are very few well-documented examples of this kind of mask in existence.', 'Painting', 'Asian Art Painting', 'Egypt', '1881-12-11', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 169, 'Israel_Museum', 'Spirit mask(egungun)', 'Masks of this elongated type were worn by members of the powerful religious and judiciary secret society known as the Ngil, which was widespread among the Northern Fang and others to the southeast of them (the Fang are a subgroup of the Pangwe people). Ngil members acted as police and judges, revealing sorcerers and handing down sentences to those who did not obey the law. (The usual punishment for sorcery was death.) Ngil masters were also known as peacekeepers, settling conflicts between clans and rival villages.', 'Painting', 'Asian Art Painting', 'Egypt', '1857-12-28', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 730, 'Israel_Museum', 'Fetish figure', 'Locally-produced objects were sought by Europeans as souvenirs and curios of what was viewed as the primitive barbarity of Africans. Picture postcards were also available depicting ceremonies and customs, which promoted the theory of fetishism and terms such as idolatry, devil-worship and evil-doing. The Kongo people refer to such figures as nkisi, or minkisi in the plural.', 'Painting', 'Asian Art Painting', 'Songye people', '1910-11-27', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 518, 'Israel_Museum', 'CeremonialBwamisociety figure', 'Minkisi come in various forms. The most common feature is a pack attached to the back or the abdomen of the figures which is usually covered with a mirror. It is this pack, and other attachments, which provide the figure with its function. It was the nganga, or priest, who operated the nkisi and ministered its powers to others. 1  The priest would order a wooden figure from the carver and then endow it with its power during a ritual at which time medicines or magically-charged materials were attached. The empowering substances could be inserted into cavities on the head or between the legs, as well as behind the glass plates. In addition to carved figures, objects including shells, horns, cloth-bags, gourds and clay pots were used as containers for this material', 'Painting', 'Asian Art Painting', 'Lega people', '1951-10-25', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 914, 'Israel_Museum', 'Mans chamberpot in the shape of a tiger', 'Ancient bronze chamberpots usually in the form of an openmouthed animal have been found in mens tombs dating to the Warring States period (403221 BCE) and the Han dynasty (206 BCE  220 CE). In later periods they were crafted in glazed ceramic like this example. Similar chamberpots made of less expensive materials continued to be used in China until indoor plumbing made life more comfortable.', 'Carving', 'Asian Art Sculpture', 'China', '1710-10-17', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 684, 'Israel_Museum', 'Marco Polo censer', 'It was once thought that incense burners such as this found in the palaces of Venice were brought to Europe by Marco Polo. In fact they date from the 18th century 500 years after Marco Polo lived.', 'Carving', 'Asian Art Sculpture', 'China', '1787-10-21', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 731, 'Israel_Museum', 'Water vessel in the form of two mandarin ducks with a lotus leaf lid', 'Mandarin ducks mate for life and are therefore a symbol of marital fidelity.', 'Carving', 'Asian Art Sculpture', 'China', '1816-12-25', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 969, 'Israel_Museum', 'Pair of beer mugs decorated with flowers and birds', 'Famille verteis a type of fine porcelain in which the colorless glaze has been delicately painted with translucent green enamel made with copper oxide. It was produced mainly for export to Europe in the 17th and 18th centuries.', 'Carving', 'Asian Art Sculpture', 'China', '1816-12-26', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 970, 'Israel_Museum', 'Seated figure possibly a musician', 'This graceful figurine its hands delicately poised to hold a now-vanished musical instrument was perhaps part of a celestial orchestra accompanying a Buddha figure. It reflects the refined taste of the Heian imperial court which influenced every aspect of aristocratic life during the 11th century', 'Carving', 'Asian Art Sculpture', 'Japan ', '1816-12-27', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 691, 'Israel_Museum', 'Votive plaque', 'Tsatsa mold-made icons depict sacred images and are used as amulets. The making of tsatsa is a compulsory skill in Tibetan monasteries and is believed to confer merit on the maker.', 'Carving', 'Asian Art Sculpture', 'Tibet', '1847-10-26', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 324, 'Israel_Museum', 'Amoghapasha Lokeshvara', 'Amoghapasha Lokeshvara the One with the unfailing Noose is identified by the noose held in one of his eight hands. He is a form of bodhisattva Avalokiteshvara (the Lord Who Looks Down) the embodiment of Buddhist compassion. The cult of this gentle bodhisattva was particularly popular in Nepal.', 'Carving', 'Asian Art Sculpture', 'Nepal', '1847-10-27', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 817, 'Israel_Museum', 'The Niwaka Festival', 'The Niwaka Festival takes place every autumn in the Yoshiwara Pleasure Quarter in Tokyo. Male and female geishas in fanciful costumes parade in colorful processions along the main streets or sit on elaborate travelling floats. This print shows three women dressed up as a puppeteer a washerwoman and a young nobleman.', 'Painting', 'Asian Art Painting', 'Kitagawa Utamaro', '1762-12-22', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 457, 'Israel_Museum', 'The courtesan Hanaogi of the Ogi House reading a letter', 'Starting around 1790 the rise of Utamaro marked the beginning of an epoch in which he was the lodestar in a galaxy of woodblock artists. After producing a few portraits of actors he turned to the portrayal of bijin (beautiful women). He enriched this genre by introducing the large head composition which fills up almost the entire print with famous courtesans in close-up. His women their elaborate hairdos rendered in exquisite detail radiate grace and femininity. No artist had more insight into the Yoshiwara Pleasure Quarter than Utamaro who spent a great part of his life there and knew the quarter and its people intimately.', 'Painting', 'Asian Art Painting', 'Kitagawa Utamaro', '1762-12-23', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 342, 'Israel_Museum', 'The star-crossed lovers Ohan and Choemon', 'The wealthy parents of Ohan forbid her to marry the poor Choemon. When Ohans parents lose their fortune she sells herself to a bordello to pay off their debts. The desperate Choemon resorts to robbery and murder to obtain the money to buy Ohans freedom. However he is caught and executed. The distraught Ohan escapes from the walled Pleasure Quarter and commits suicide on Choemons grave.', 'Painting', 'Asian Art Painting', 'Kitagawa Utamaro', '1744-11-15', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 805, 'Israel_Museum', 'Ritual scepter (vajra)', 'Theghantaandvajraare the chief implements of priests of esoteric Tantric Buddhism. The ritual bell represents the female principle and wisdom. The ritual scepter represents the male principle and is a mighty weapon used to dispel darkness and negative forces. Together the bell and the scepter symbolize the unity of compassion and wisdom and the fundamental oneness of all opposites the realization of which leads to salvation. Holding the scepter in his right hand and the bell in his left the priest acquires divine power.', 'Carving', 'Asian Art Sculpture', 'Tibet', '1895-10-20', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 801, 'Israel_Museum', 'White Tara', 'White Tara is one of the most popular female Tantric deities and is associated with compassion long life and healing. She is said to be as white and radiant as the moon and is usually depicted holding a lotus flower. In China she became known as Guanyin Goddess of Mercy.', 'Carving', 'Asian Art Sculpture', 'Tibet', '1757-10-12', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 297, 'Israel_Museum', 'Boulder in the form of a mountain with a grotto', 'Meditation in the Ancient MountainsEverlasting guardianship of the eternal hillstranslucent ether widely separates high and lowsymbol of natures infinitudelooking up to the heavenly bodies beyond the cloudscontemplating the hidden foundations of the mountainsmen acquire knowledge of the causes of light and darknessheaven bends down to the upreaching earth through limitless azure fleecily float diaphanous clouds the sage has said that heaven is not far since we are encompassed by its light mightiest mountains wear away and time destroys the strongest beams sage and poet alike must vanish with the rounding scene but the imperial poet in his eyrie pavilion fixes forever the transient scene in celestial verse humble earthbound artist preserves these lofty thoughtsenshrined in this precious tribute.', 'Carving', 'Asian Art Sculpture', 'China', '1757-10-13', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 673, 'Israel_Museum', 'Noh mask of an old woman (uba)', 'The gray hair lines and furrows on the face of this mask show that the old woman has experienced a great deal during her life.', 'Carving', 'Asian Art Sculpture', 'Japan ', '1871-11-17', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 624, 'Israel_Museum', 'The Uchikawa River with the village of Sekiya and the Sujin Forest seen through a round window', 'Hiroshige II was a young print artist Chinpei Suzuki who married Hiroshiges daughter Otatsu. He was given the artist name of Shigenobu. ', 'Painting', 'Asian Art Painting', 'Hiroshige', '1841-11-21', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 804, 'Israel_Museum', 'Pair of covered cups', 'Named after the district in Japan where it is produced Satsuma earthenware is an elaborately decorated type of ceramic. It is covered with a creamy finely crackled glaze that serves as a background for minutely painted scenes highlighted by extravagant gilding.', 'Carving', 'Asian Art Sculpture', 'Japan ', '1895-10-12', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 11, 'Israel_Museum', 'Jusepe de Ribera', 'Considered the forefather of Spanish Baroque painting, Jusepe de Ribera introduced the highly expressive Neapolitan Baroque style to his native Spain and had an important influence on the work of Velzquez, Zurbarn, and Murillo. As a young man Ribera traveled extensively in Italy, absorbing the influence of the Renaissance masters, but most of all of Caravaggio, whose reckless lifestyle he even imitated.', 'Painting', 'European Art Painting', 'Spanish', '1762-12-28', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 12, 'Israel_Museum', 'St. Peter in Prison', 'About that time Herod the king laid violent hands upon some who belonged to the church. He killed James the brother of John . . . and . . . he proceeded to arrest Peter also. . . . And when he had seized him, he put him in prison.', 'Painting', 'European Art Painting', 'Rembrandt van Rijn', '1983-12-10', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 535, 'Israel_Museum', 'Hogonequestrian statue', 'Most Dogon sculptures are carved for personal or family use, to commemorate the founding of a community, or for community worship. The horse, symbolizing power and wealth, is incorporated into many ceremonial and functional sculptures, and equestrian figures are also common in Dogon art. Horses were introduced to western Africa a thousand years ago and became the prerogative of rulers and nobles. In sculpture their presence always denotes the riders high status. The theme of the horse and rider is found throughout the art of the western Sudan. Among the Dogon, horses are principally the mounts of the revered hogons, supremely important, semidivine leaders of great wisdom.', 'Carving', 'Others Sculpture', 'Egypt', '1854-11-13', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 434, 'Israel_Museum', 'Ritual dagger (phurbu)', 'Most of what is known of the Indian k?la lore has come by way of Tibetan culture.', 'Carving', 'Asian Art Sculpture', 'Tibet', '1831-12-27', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 889, 'Israel_Museum', 'Large platter', 'Large platters such as this were produced specially for the Ottoman sultans for use in ceremonial banquets.', 'Carving', 'Asian Art Sculpture', 'China', '1799-10-27', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 909, 'Israel_Museum', 'Tamonten Guardian of the North one of the Four Guardian Kings of the Four Directions', 'In Japanese temples a figure of Tamonten usually stands at one of the four corners of the altar. He is depicted as a fierce armor-clad warrior punisher of evil-doers and defender of Buddhism standing on a demon symbol of ignorance and the enemy of Buddhism. He holds a spear in one hand and a small pagoda in the other; the pagoda symbolizes the divine treasure house whose contents he guards. This sculpture is composed of several parts made during different periods the later parts probably replacing broken or missing elements.', 'Carving', 'Asian Art Sculpture', 'Hiroshige', '1799-10-28', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 141, 'Israel_Museum', 'Suspense', 'The roots of Suspense lie in British Minimalism of the 1960s which Kadishman came to know when he studied at St Martins School of Art under Minimalist Anthony Caro and others. Between 1961 and 1965 Kadishman developed his own language of sculpture based on fundamental forms that seem to defy gravity. In 1966 the Israel Museum commissioned him to create a piece for its new Art Garden; the result was this large metal version of two smaller works in different materials he had created in London.', 'Carving', 'Israel Art Sculpture', 'Menashe Kadishman', '1711-10-13', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 608, 'Israel_Museum', 'This Time I Will Uproot the Whole Population of the', 'Pichhadze began studying art as a child with the sculptor Razu Ramishvili. He moved with his family to Israel in 1973. There his work revealed influences of the primitivist stylings of Georgian painter Niko Pirosmanashvili.', 'Carving', 'Israel Art Sculpture', 'Meir Pichhadze', '1762-10-27', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 632, 'Israel_Museum', 'The Broken Glass Door', 'The interaction of opposites gives Suspense its power. It seems heavy and dense and yet part of it appears to float in the air. The work is constructed according to careful calculations of equilibrium but at the same time it reflects Kadishmans strong affinity for nature particularly for the desert. The resulting suspense is a modernist-minimalist expression of a desert phenomenon: eroded by wind and water rocky masses come to be so precariously balanced that the slightest movement can bring them tumbling down. Kadishman chose to paint his sculpture industrial yellow the color of the tractor in nature as he explained. Thus the work simultaneously addresses a natural phenomenon and human interference with nature.', 'Carving', 'Israel Art Sculpture', 'Menashe Kadishman', '1725-10-21', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 923, 'Israel_Museum', 'Nahum Tevet', 'Painting Lesson No. 5is a three-dimensional painting that can be viewed from different vantage points with the floor as its canvas. At the same time it might be considered a dictionary or catalogue of the modernist languages of sculpture from Russian Constructivism in the early 20th century to Minimalism in the 1960s.', 'Carving', 'Israel Art Sculpture', 'Nahum Tevet', '1733-12-19', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 304, 'Israel_Museum', 'Igael Tumarkin', 'Tumarkins mixed-media sculpture was undertaken two years after the start of the Lebanon war a period during which nearly every day was marked by the announcement of the death or wounding of a soldier on the northern front. During the years 1982-84 the artist concentrated on the themes of crucifixion and death employing these motifs to highlight worldwide cases of injustice and cruelty.', 'Carving', 'Israel Art Sculpture', 'Micha Ullman', '1796-10-28', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 32, 'Israel_Museum', 'Self Portrait', 'Jacob Steinhardt worked mainly in woodcuts depicting biblical and Jewish subjects. He participated in the Berlin Secession and founded the Pathetiker Group.[1] He was a member of the Bezalel school group. In 1934 Steinhardt opened an art school in Jerusalem.', 'Painting', 'Israel Art Painting', 'Jakob Steinhardt', '1807-10-10', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 31, 'Israel_Museum', 'The Blessing of the Candles', 'Jacob Steinhardt was born in Zerkow Germany (now ?erkw Poland). He attended the School of Art in Berlin in 1906 then studied painting with Lovis Corinth and engraving with Hermann Struck in 1907. From  where he associated with Henri Matisse and Thophile Steinlen and in 1911 he was in Italy. When World War I broke out he enlisted in the German Army and served on the 1908 to 1910 he lived in Paris', 'Painting', 'Israel Art Painting', 'Jakob Steinhardt', '1897-11-28', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('AA', 33, 'Israel_Museum', 'Jews Going to Selichot Prayers', ' In 1948 he became Chairman of the Graphics Department at the Bezalel Academy of Art and Design. He served as director of the school in 1954-1957. German police dominated by the Nazis who recently came to power.', 'Painting', 'Israel Art Painting', 'Jakob Steinhardt', '1729-12-22', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 537, 'Israel_Museum', 'An eagle over the snowbound plain of Susaki', 'Hiroshige lived in the barracks until the age of 43. Genemon and his wife died in 1809 when Hiroshige was 12 years old just a few months after his father had passed the position on to him. ', 'Painting', 'Asian Art Painting', 'Hiroshige', '1815-10-27', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 611, 'Israel_Museum', 'Ando Hiroshige', 'Hiroshige is best known for his landscapes such as the series The Fifty-three Stations of the T?kaid? and The Sixty-nine Stations of the Kiso Kaid?; and for his depictions of birds and flowers. The subjects of his work were atypical of the ukiyo-e genre whose typical focus was on beautiful women popular actors and other scenes of the urban pleasure districts of Japans Edo period (16031868). The popular Thirty-six Views of Mount Fuji series by Hokusai was a strong influence on Hiroshiges choice of subject though Hiroshiges approach was more poetic and ambient than Hokusais bolder more formal prints.', 'Painting', 'Asian Art Painting', 'Hiroshige', '1799-10-29', true, null, null, null);
INSERT INTO ns_works (wor_workcharid, wor_worknumid, wor_databaseentrymuseum, wor_workname, wor_workdescription, wor_workphysicalproperty, wor_workclassification, wor_workcreator, wor_workcreationdate, wor_workborrowable, wor_workgeographicregionoforigin, wor_workcountryoforigin, wor_workfieldofscience) VALUES ('BB', 208, 'Israel_Museum', 'A sudden shower at Ohashi bridge', 'It was not until 18291830 that Hiroshige began to produce the landscapes he has come to be known for such as the Eight Views of ?mi series.[8] He also created an increasing number of bird and flower prints about this time.[7] About 1831 his Ten Famous Places in the Eastern Capital appeared and seem to bear the influence of Hokusai whose popular landscape series Thirty-six Views of Mount Fuji had recently seen publication', 'Painting', 'Asian Art Painting', 'Hiroshige', '1815-10-26', true, null, null, null);
